  return (
    <PersonCardWrapper>
      <DetailsCardImage image={data.profile_path} />

      <div>
        <PersonCardTitle></PersonCardTitle>
        <PersonCardSubTitle></PersonCardSubTitle>
        <PersonCardSubTitle></PersonCardSubTitle>
        <PersonCardDescr></PersonCardDescr>
        <PersonCardSubTitle></PersonCardSubTitle>
      </div>
    </PersonCardWrapper>
  );
};
